import React from "react";
import { useDispatch } from "react-redux";
import { login } from "./features/user";
export default function Login() {
  const dispatch = useDispatch();
  return (
    <div>
      <button
        onClick={dispatch(
          login({ name: "rishit", age: "20", addr: "rrr", fff: "wwws" })
        )}
      >
        login
      </button>
    </div>
  );
}
